import React from "react";

import Movie from "./movie";
import classes from "./movies.module.css";

const Movies = ({ list }) => {
  let cards = <h3>Loading...</h3>;

  if (list) {
    cards = list.map((m, i) => <Movie key={i} item={m} />);
  }

  return (
    <div class="table-responsive table-hover">
    <table className="table table-hoverable">
      {/* <div className={classes.Container} style={{marginTop: 100}}>
        <div className={classes.ContainerInner}>{cards}</div>
      </div> */}
      <div className={classes.searchresults}>{cards}</div>
    </table>
    </div>
    // <div class="table-responsive table-hover" className={classes.results1}>
    // <table className="table table-hover">
    //   {/* <div className={classes.Container} style={{marginTop: 100}}>
    //     <div className={classes.ContainerInner}>{cards}</div>
    //   </div> */}
    //   <div className={classes.ContainerInner}>{cards}</div>
    // </table>
    // </div>
  );
};

export default Movies;
